import Logo from "../Assets/brand-logo/logo.svg";

function Sidenav() {
  return (
    <aside class="p-4">
      <div className="flex justify-center">
        <img className="w-24" src={Logo} alt="logo" />
      </div>
    </aside>

  );
}

export default Sidenav;
